import './project.css';
import React from 'react';
import { Container, Row, Tabs, Tab } from 'react-bootstrap'; 

import 'bootstrap/dist/css/bootstrap.min.css';
import image6 from '../images/Group 89314.png';
import image7 from '../images/Group 89313.png';
import image8 from '../images/Group 89315.png';
import image9 from '../images/Group 89312.png';
const Project = () => {
  return (
    <Container className="py-4">
      <Row className="justify-content-center"> {/* Fix the className attribute */}
        <Tabs justify variant="pills" defaultActiveKey="tab-1" className="mb-1 p-0">
          <Tab eventKey="tab-1" title="Tag 1">
            Tab 1 content
          </Tab>
          <Tab eventKey="tab-2" title="Tag 2">
            Tab 2 content
          </Tab>
          <Tab eventKey="tab-3" title="Tag 3">
            Tab 3 content
          </Tab>
        </Tabs>
      </Row>
    </Container>
  );
};

export default Project;
